import React from "react";

import Header from "./Header";
import Footer from "./Footer";

import Top from "./Top";

function Users() {
  return (
    <div>
      <Header />

      <div class="menu">
          <a class="links" href="/users">Cadastrar Usuário</a>
          <a class="links" href="/users/list">Buscar Usuários</a>
    </div>

      <Footer />
    </div>
  );
}

export default Users;
